import React from 'react';

const Header = () => {
    return (
        <header className="header">
            <h1>Welcome to BargainHunter</h1>
            <nav className="nav">
                <ul>
                    <li><a href="#">Sell Your Items</a></li>
                    <li><a href="#">Buy Items</a></li>
                    <li><a href="#">List Home</a></li>
                </ul>
            </nav>
        </header>
    );
};

export default Header;
